  - - '3'
    - Experimental Factor Ontology
    - 
    - EFO is an application focused ontology modelling the experimental variables
      in the Gene Expression Atlas, EBI. The ontology has been developed to increase
      the richness of the annotations that are currently made in the ArrayExpress
      repository, to promote consistent annotation, to facilitate automatic annotation
      and to integrate external data. The ontology describes cross-product classes
      from reference ontologies in area such as disease, cell line, cell type and
      anatomy.
    - http://bioportal.bioontology.org/ontologies/EFO
