    - Units of Measurement Ontology
    - 
    - Metrical units for use in conjunction with PATO
    - http://bioportal.bioontology.org/ontologies/UO
    - UO
  - - '6'
    - BRENDA Tissue and Enzyme Source Ontology
    - 
    - A structured controlled vocabulary for the source of an enzyme. It comprises
      terms for tissues, cell lines, cell types and cell cultures from uni- and multicellular
      organisms.
    - http://bioportal.bioontology.org/ontologies/BTO
    - BTO
