    - National Center for Biotechnology Information (NCBI) Organismal Classification
    - 
    - A taxonomic classification of living organisms and associated artifacts for
      their controlled description within the context of databases.
    - http://purl.obolibrary.org/obo/ncbitaxon.owl
    - NCBITAXON

