    - ! "Mechanism based resistance to asprin - Part C PENTACON-39 An acute NSAID
      treatment study. Healthy volunteers were given NSAIDs orally and blood was drawn
      pre dose and 2 hours post dose. Volunteers were treated with a single dose of
      one of 5 NSAIDs in an open label, non-randomized design:\r\nIbuprofen (600 mg)
      (1)\r\nCelecoxib (200 mg) (2)\r\nAcetaminophen (1000 mg) (3)\r\nNaproxen (500
      mg) (4)\r\nDiclofenac (100 mg) (5)\r\n\r\nn = 7 subjects were enrolled in each
      treatment group (a total of n=35 subjects)\r\n\r\nEach volunteer completed two
      study periods separated by at least 2 weeks:\r\n1. Control period: blood was
      drawn at 0 hours and at 2 hours. No NSAID was given \r\n2. Treatment Period
      : blood was drawn at 0 hours and at 2 hours. The NSAID was given immediately
      after the 0 hours blood draw as a single tablet orally. \r\n\r\nSample preparation
      and handling\r\nSamples were collected at Penn between 7/2012 and 3/2013\r\nBlood
      draw (4.5mL) into buffered sodium citrate (0.105M ~ 3.2%); BD Glass Vacutainer
      #366415\r\nPlasma prepared by centrifugation at 4 Celsius (precise speed unknown)\r\nPlasma
      transferred into polypropylene tubes and frozen at -80 Celsius. \r\n\r\nFreeze/thaw
      cycles\r\nStorage at -80\r\nPeriod 2 samples only were thawed and aliquoted
      (for plasma concentration measurements) in 5/2013.\r\nAll samples were thawed
      and aliquoted for shipping to Cambridge June 5, 2014. \r\nShipped to Cambridge
      on dry ice.\r\n\r\nExternal identifiers: CTRC #0926, IRB# 801907"
